const CartItem = ({CartItem}) => {
    const  {name, quantity} = CartItem;
    return (
        <div className='cart-item-container'>
           <div className='item-details'>
            <span className='name'>{name}</span>
            <span className='price'>{quantity}</span>
            </div>
        </div>
    );


}
export default CartItem;
